css:
.editor-colors {
  background-color: #0c1014;
  color: #99d1ce;
}
.editor {
  background-color: #0c1014;
  color: #99d1ce;
}
.editor .wrap-guide {
  background-color: #0c1014;
}
.editor .indent-guide {
  color: #373b41;
}
.editor .invisible-character {
  color: #373b41;
}
.editor .gutter {
  background-color: #0c1014;
  color: #245361;
}
.editor .gutter .line-number.cursor-line {
  background-color: #0c1014;
  color: #599cab;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #599cab;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #969896;
}
.editor .invisible {
  color: #99d1ce;
}
.editor .cursor {
  color: #99d1ce;
}
.editor .selection .region {
  background-color: #0a3749;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #969896;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #245361;
}
.entity.name.type {
  color: #edb443;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #2aa889;
}
.keyword {
  color: #4e5166;
}
.keyword.control {
  color: #4e5166;
}
.keyword.operator {
  color: #99d1ce;
}
.keyword.other.special-method {
  color: #195466;
}
.keyword.other.unit {
  color: #d26937;
}
.storage {
  color: #4e5166;
}
.constant {
  color: #888ca6;
}
.variable {
  color: #c23127;
}
.variable.interpolation {
  color: #98261e;
}
.variable.parameter.function {
  color: #99d1ce;
}
.invalid.illegal {
  background-color: #c23127;
  color: #0c1014;
}
.string {
  color: #2aa889;
}
.string.regexp {
  color: #33859e;
}
.string.regexp .source.ruby.embedded {
  color: #d26937;
}
.string.other.link {
  color: #c23127;
}
.punctuation.definition.comment {
  color: #245361;
}
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #99d1ce;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #195466;
}
.punctuation.definition.bold {
  color: #edb443;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #4e5166;
  font-style: italic;
}
.punctuation.definition.tag {
  color: #195466;
}
.punctuation.definition.string {
  color: #2aa889;
}
.punctuation.section.embedded {
  color: #98261e;
}
.support.class {
  color: #edb443;
}
.support.function {
  color: #33859e;
}
.support.function.any-method {
  color: #195466;
}
.entity.name.function {
  color: #195466;
}
.entity.name.class,
.entity.name.type.class {
  color: #edb443;
}
.entity.name.section {
  color: #195466;
}
.entity.name.tag {
  color: #c23127;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #d26937;
}
.entity.other.attribute-name.id {
  color: #195466;
}
.meta.class {
  color: #edb443;
}
.meta.link {
  color: #d26937;
}
.meta.require {
  color: #195466;
}
.meta.selector {
  color: #4e5166;
}
.meta.separator {
  background-color: #373b41;
  color: #99d1ce;
}
.none {
  color: #99d1ce;
}
.markup.bold {
  color: #d26937;
  font-style: bold;
}
.markup.changed {
  color: #4e5166;
}
.markup.deleted {
  color: #c23127;
}
.markup.italic {
  color: #4e5166;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #195466;
}
.markup.inserted {
  color: #2aa889;
}
.markup.list {
  color: #c23127;
}
.markup.quote {
  color: #d26937;
}
.markup.raw.inline {
  color: #2aa889;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #2aa889;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
